class SerchForm extends Component {
    render() {
        return (
            <Row>
                <Col md={6} lg={6}

                >
                    <Card
                        cardClass=" "
                        cardBodyClass="myap-p-t-0"
                    >
                        <div className="form-group row ">
                            <label
                                htmlFor="fname"
                                className="col-sm-3 col-md-2 text-right control-label"
                            >
                                waybillnumber
                            </label>
                            <div className="col-sm-9  col-md-6 ">
                                <input
                                    {...props}
                                    type={type}
                                    className="form-control"
                                    id={id}
                                    placeholder={placeholder}
                                    onChange={onChange}
                                />
                                {helperText === "false" ? '' :
                                    <small
                                        id="textHelp"
                                        className="form-text text-muted"
                                    >
                                        {helperText}
                                    </small>
                                }
                            </div>
                        </div>


                        {/* <FormInput
                            label="waybillnumber"
                        ></FormInput>
                        <buton> rrr</buton> */}

                    </Card>
                </Col>
            </Row>
        );
    }
}

export default SerchForm;
